import React from 'react';
import Products from './components/Products';//מערך של המוצרים
import ProductCard from './components/ProductCard';//כרטיס מוצר קומפוננטה
const ProductsPage = () => {
  return (
    <div>
      <h1>All Your Summer Camp Needs Under One Roof
 
      Soft Trunks, Labels, Laundry, Bunk Essentials & More
      </h1>
 <div className="products-grid">
  {Products.map(product => (
    <ProductCard
    key={product.id}
    name={product.name}
    price={product.price}
    description={product.description}
    image={product.image}
    />
    ))}

 </div>
    </div>
  );
};

export default ProductsPage;
